  [],\n\t\"revision_timestamp\": \"2015-05-06T21:02:46.787517\",\n\t\"name\": \"20mn-variable-specific-impulse-colloid-thruster-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"During Phase I, Busek designed and manufactured
  an electrospray emitter capable of generating 20 mN in a 7\" x 7\" x 1.7\" package.
  \ The thruster consists of nine porous-surface emitters operating in parallel from
  a common propellant supply.  Each emitter is capable of supporting over 70,000 electrospray
  emission sites, with the plume from each emitter being accelerated through a single
  aperture, eliminating the need for individual emission site alignment to an extraction
  grid.  The total number of emission sites during operation is expected to approach
  700,000.rnPhase II results will focus on optimization and characterization of the
  thruster fabricated during the Phase I effort, as well as fabrication of additional
  porous emitters for full-scale testing.  Propellant will be supplied to the thruster
  via existing feedsystem and micro-valve technology previously developed by Busek,
  under the NASA ST7-DRS mission, and follow-on electric propulsion programs.  Methods
  for extending thruster life beyond the previously demonstrated 450 hours, will be
  investigated and include potential alternate emitter materials selection, and bi-polar
  thruster operation.  The life extending capabilities will be demonstrated on a sub-scale
  version of the thruster developed.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
